ISLAMABAD, Feb 9 (APP): Mutahidda Quomi Movement’s (MQM) Rehan Akram has won the Sindh Assembly election from PS-122, Karachi Central-I, by securing 48,170 votes.
According to unofficial result issued by Returning Officer/ECP, his runner-up was independent candidate Farhan Saleem, who bagged 23,018 votes.  Voters’ turn-out remained 55.57%.
